function check() {
  const book = document.getElementById("book-item");
  book.addEventListener("click", (e) => {
    const bookId = book.getAttribute("data-id");
    const XHR = new XMLHttpRequest();
    XHR.open("GET", '')
    e.preventDefault();
  });
}

window.addEventListener("load", check);
